import React from "react";
import Navbar from "./Navbar";
import Header from "./Header";
import Particles from "react-particles-js";

const Home = () => {
  const classes = useStyles();
  return (
    <>
      <Navbar />
      <Header />
      <Particles
        params={{
          particles: {
            number: {
              value: 45
            }
          }
        }}
      />
    </>
  );
};

export default Home;
